    es.search({
        "lat": 40.710803,
        "lng": -73.964040,
        "accessToken" : config.FACEBOOK_API_KEY,
      }).then( (events) => {
            res.status(200).json({
                events
            })
      }).catch((err) => {
        res.status(500).json({err})
      });
}

export default facebook;

